/**
 * @param {number[]} deck
 * @return {boolean}
 给定一副牌，每张牌上都写着一个整数。

此时，你需要选定一个数字 X，使我们可以将整副牌按下述规则分成 1 组或更多组：

每组都有 X 张牌。
组内所有的牌上都写着相同的整数。
仅当你可选的 X >= 2 时返回 true。
 */

let maxGYNum = function (a, b) {
    let yu = 1
    while (true) {
        yu = a % b
        if(yu === 0){
            return b;
        }
        a = b
        b = yu;
    }
}

var hasGroupsSizeX = function (deck) {
    let numSumMap = {}
    let max = null
    let min = null
    for (let index in deck) {
        let num = deck[index]
        if (numSumMap[num] == null) {
            numSumMap[num] = 1;
        } else {
            numSumMap[num]++;
        }
    }
    for (let numIndex in numSumMap) {
        if (min == null) min = numSumMap[numIndex]
        else min = min > numSumMap[numIndex] ? numSumMap[numIndex] : min
        if (max == null) max = numSumMap[numIndex]
        else max = max < numSumMap[numIndex] ? numSumMap[numIndex] : max
    }

    if (min == null || max == null) return false
    if (min < 2) return false
    let yu = max
    for (let numIndex in numSumMap) {
        if(numSumMap[numIndex] == max) continue
        let tempYu = maxGYNum(numSumMap[numIndex],max)
        if(yu != tempYu){
            yu = maxGYNum(yu,tempYu)
        }
    }
    if(yu < 2) return false
    for (let numIndex in numSumMap) {
        if (numSumMap[numIndex] % yu != 0) return false
    }
    return true
};

